const messages = $input.first().json.message

const novaData = new Date()
const horaAtual = new Date(novaData.getTime() - 3 * 60 * 60 * 1000)

const conversation = messages
  .filter(m => m?.message?.content !== null && m?.message?.content !== undefined)
  .map((message) => {
    const originalDate = new Date(message.created_at)
    const adjustedDate = new Date(originalDate.getTime() - 3 * 60 * 60 * 1000) // ajuste horário

    return {
      type: message.message.type,
      content: message.message.content,
      time: adjustedDate.toISOString()
    }
  })

conversation.reverse()

// Última mensagem
const ultimaMensagem = conversation[conversation.length - 1]
const horaUltimaMensagem = new Date(ultimaMensagem.time)

// Cálculo do tempo decorrido
const tempoDecorridoMs = horaAtual - horaUltimaMensagem
const tempoDecorridoMin = Math.floor(tempoDecorridoMs / 60000)

return {
  tempoDecorridoMin
}

